import React, {useState} from 'react';
import './Contact.css'
function Contact() {


  return (
      <section className="contact" id="contact">
        <form>
          <div className="contact__">
          <label for="fname">First name:</label>
          <input type="text" id="fname" name="fname"/>
          </div>
        </form>
     </section>
  );
}

export default Contact;
